import { Link } from 'react-router-dom';


class UserAccountInfo extends Component {
    render() {
        return (
            <div>
                <p>Username: testName</p>
                <p>Password: ******</p>
                <p>Signiture Image</p>
                <Link to="/updateUserInfo">
                    <button>Update</button>
                </Link>
            </div>
        );
    }
}

export default UserAccountInfo;
